script: |
  super -f text -I q4933.spq | sort > q4933.out

inputs:
  - name: q4933.spq
    data: |
      SELECT ( - col1 ) AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT ( ( 92 * col2 ) IN ( + col2 * - col0 ) );
  - name: tab0

outputs:
  - name: q4933.out
    data: |
      -1
      -21
      -81
